    else if (mygroup.length > 0) {
        const result = String(mygroup.map((item) => { return (`<html><body><ul><li>${item.name}</li></ul></body></html>`) }))
        res.send(result)
    }
    else res.send(`<html><body><ul><li>Not valid</li></ul></body></html>`);

}
module.exports = {
    getMyGroup,
    addGroupMember,
    getMyGroupById,
    getNameById
}

